import React from "react";
import Layout from "../../components/layout";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from "@chakra-ui/react";
import PlayerList from "../../components/playerList";

const Team = ({ players, coaches }) => {
  const { d1, d3, staff } = players.reduce(
    (acc, player) => {
      let d3 = [];
      let d1 = [];
      if (player.division === "D3") {
        d3.push(player);
      }
      if (player.division === "D1") {
        d1.push(player);
      }
      console.log("ðŸš€", { ...acc, d1, d3: [...d3, ...acc.d3] });
      return { ...acc, d1: [...d1, ...acc.d1], d3: [...d3, ...acc.d3] };
    },
    { d1: [], d3: [], staff: coaches }
  );

  console.log({ d1, d3, staff });

  return (
    <Layout header="Players">
      <Tabs variant="solid-rounded" isFitted size="md">
        <TabList>
          <Tab>Bombers DI</Tab>
          <Tab>Bombers DIII</Tab>
          <Tab>Coaches & Staff</Tab>
        </TabList>
        <TabPanels>
          <TabPanel>
            <PlayerList list={d1}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList list={d3}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList list={staff}></PlayerList>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default Team;
